-- ----------------------------
-- Table structure for tb_newbee_mall_goods_info
-- ----------------------------
DROP TABLE IF EXISTS `tb_newbee_mall_goods_info`;
CREATE TABLE `tb_newbee_mall_goods_info`  (
  `goods_id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'Commodity table main key id',
  `goods_name` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'Trade name',
  `goods_intro` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'Product profile',
  `goods_category_id` bigint(20) NOT NULL DEFAULT 0 COMMENT 'Associative classification id',
  `goods_cover_img` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '/admin/dist/img/no-img.png' COMMENT 'Commodity master chart',
  `goods_carousel` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '/admin/dist/img/no-img.png' COMMENT 'Commodity carousel chart',
  `goods_detail_content` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'Commodity details',
  `original_price` int(11) NOT NULL DEFAULT 1 COMMENT 'Commodity prices',
  `selling_price` int(11) NOT NULL DEFAULT 1 COMMENT 'Actual selling price',
  `stock_num` int(11) NOT NULL DEFAULT 0 COMMENT 'Quantity of goods in stock',
  `tag` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'Brand label',
  `goods_sell_status` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'Shelf status 0-Delist area 1-Listing area',
