lation and comfortable wear. ● Stereo headphones ● Hybrid silicone ear tips (2 of each size SS/S/M/L) *M size is installed on this headphone when shipped. ● Portable bag (×1) *EXTRA BASS and EXTRABASS are trademarks of Sony Corporation', 229, 185, 1000, '', 0, 0, '2024-09-18 13:21:28', 0, '2024-10-13 10:41:59'),
