(10802, 'Redmi Note 7 48MP Dual-Camera Budget Phone with Snapdragon 660', '18-Month Super Long Warranty, 4000mAh Ultra-Long Battery Life, 6GB+64GB Bright Black Gaming Smartphone, Xiaomi Redmi', 20, '/goods-img/92beacb0-f692-42ff-a20f-8fecd2b0c046.jpg', '/goods-img/92beacb0-f692-42ff-a20f-8fecd2b0c046.jpg', '<p>* How to set the camera to 48MP? Open the camera — swipe right to switch to “Pro” mode — click on the upper left of the screen to open 48MP.</p><p>* How to set full-screen mode? Click Settings — click Full-Screen — enter full-screen settings, where you can choose classic navigation or full-screen gestures. Choose full-screen gestures for gesture learning.</p><p>* Does it support OTG function? Yes.</p><p>* Does the Redmi Note 7 come with Android 9.0? The first batch of products shipped with MIUI 10 (Android 9.0).</p><p>* Does it have a breathing light? Does it support NFC? Does it support a radio? Yes, it has a breathing light, does not support NFC, supports radio.</p><p>* Does the 48MP mode support AI scene recognition? The AI recognition is supported in normal camera mode but not in 48MP mode.</p><p>* Does it support King of Glory Vulkan mode? Currently, it does not support King of Glory Vulkan mode. Common questions about Redmi Note 7.</p>', 1199, 1099, 1000, 'Mobile Phone', 0, 0, '2024-09-18 13:38:32', 0, '2024-10-13 10:41:59'),
(10803, 'Redmi Note 7 48MP Dual-Camera Budget Phone with Snapdragon 660', '18-Month Super Long Warranty, 4000mAh Ultra-Long Battery Life, 6GB+64GB Twilight Gold Gaming Smartphone, Xiaomi Redmi', 0, '/goods-img/0cf95c37-2665-4894-bd42-5f8de06c6d94.jpg', '/goods-img/0cf95c37-2665-4894-bd42-5f8de06c6d94.jpg', '<p>* How to set the camera to 48MP? Open the camera — swipe right to switch to “Pro” mode — click on the upper left of the screen to open 48MP.</p><p>* How to set full-screen mode? Click Settings — click Full-Screen — enter full-screen settings, where you can choose classic navigation or full-screen gestures. Choose full-screen gestures for gesture learning.</p><p>* Does it support OTG function? Yes.</p><p>* Does the Redmi Note 7 come with Android 9.0? The first batch of products shipped with MIUI 10 (Android 9.0).</p><p>* Does it have a breathing light? Does it support NFC? Does it support a radio? Yes, it has a breathing light, does not support NFC, supports radio.</p><p>* Does the 48MP mode support AI scene recognition? The AI recognition is supported in normal camera mode but not in 48MP mode.</p><p>* Does it support King of Glory Vulkan mode? Currently, it does not support King of Glory Vulkan mode. Common questions about Redmi Note 7.</p>', 1199, 1099, 1000, '', 0, 0, '2024-09-18 13:38:32', 0, '2024-10-13 10:41:59
(10804,'Redmi Note7 48MP Dual Camera Budget Phone with Full Snapdragon 660','4000mAh Ultra Long Battery Life 6GB+64GB Dream Blue Gaming Smartphone Xiaomi Redmi',0,'/goods-img/f6c46245-b957-41ed-b235-133c17cba7f9.jpg','/goods-img/f6c46245-b957-41ed-b235-133c17cba7f9.jpg','<p>*How to set the camera to 48MP? Open the camera — swipe right to switch to “Pro” mode — tap the “48MP” in the upper left corner to enable 48MP ultra-clear mode.</p><p>*How to set full-screen mode? Click settings — click full screen — enter the full screen settings where two options will appear; you can choose classic navigation or full-screen gestures. Select full-screen gestures to learn gestures and operate in full-screen mode.</p><p>*Does it support OTG functionality? Yes.</p><p>*Is the factory-installed version of Redmi Note7 Android 9.0? The first batch of this product was shipped with MIUI 10 (Android 9.0).</p><p>*Does it have a breathing light? Does it support NFC? Does it support radio? It has a breathing light, does not support NFC, and supports radio.</p><p>*Does the 48MP mode support AI scene recognition? Is there a quick switching method? The 48MP mode does not support AI scene recognition; the regular camera mode does support AI recognition.</p><p><span style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem;\">*Does it support King of Glory Vulkan mode? Currently, it does not support King of Glory Vulkan mode. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Redmi Note 7 Frequently Asked Questions</span></p>',1199,1099,1000,'',0,0,'2024-09-18 13:38:32',0,'2024-10-13 10:41:59'),
